/**
 * @param {number[]} nums
 * @return {number}
 */
var minGroupsForValidAssignment = function(nums) {
    function divide(size, limit){
        if(size === limit || size === limit + 1) return 1;
        if(size < limit*2 || size < limit) return -1;

        if(size%limit > Math.floor(size/limit)) return -1

        return Math.ceil(size/(limit + 1))
    }

    const groups = new Map();
    
    for (const num of nums) {
        groups.set(num, (groups.get(num) || 0) + 1);
    }
    const freqs = [...groups.values()];

    const minSize = Math.min(...freqs);
    const maxSize = Math.max(...freqs);

    if(maxSize - minSize <= 1) return groups.size;

    // Divide group size
    function caculateTotal(minSize){
        let total = 0;
        
        for (let index = 0; index < freqs.length; index++) {
            const div = divide(freqs[index], minSize);
            if(div === -1) return Infinity;
            total += div;
        }
        
        return total
    }

    let result = Infinity;
    for (let size = 1; size <= minSize; size++) {
        result = Math.min(result, caculateTotal(size))
    }

    return result
};

